import React from 'react';
import logo from './108953836_149458020118064_7065387494774302952_o.jpg'

const Card = ({name, email, id}) => {
	return(
		<div className='bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5 tc'>
			<img alt='robots' src={logo} />
			<div>
				<h2>{name}</h2>
				<p>{email}</p>
			</div>
		</div>
	);
}

export default Card;
